import React from "react";
import "./signIn.css"
import 'bootstrap/dist/css/bootstrap.css';


function SignIn() {
  return (
    <div className="sign_in_container">
      <div className="sign_in_input">
        <h1>Sign in</h1>
        <div className="mb-3 sign_in_input">
          <label htmlFor="inputUsername" className="form-label">User Name</label>
          <input type="text" className="form-control" id="inputUsername" name="username" />
        </div>
        <div className="mb-3 sign_in_input">
          <label htmlFor="inputPassword" className="form-label">Password</label>
          <input type="password" className="form-control" id="inputPassword" name="password" />
        </div>
      </div>

      <div className="button_container">
        <button className="btn btn-primary sign_in_button" value="register">Log In</button>
        <button className="btn btn-primary sign_in_button" value="register">Sign Up</button>
      </div>
    </div>
  );
}

export default SignIn;
